function Food() {
  return <h3>I love potato</h3>;
}

function App() {
  return (
    <div>
      <h1>hello!!!</h1>
      <Food
        fav="kimchi"
        something={true}
        papapapa={["hello", 1, 2, 3, 4, true]}
      />
    </div>
  );
}

export default App;
